import React,{ Component } from 'react';
import './App.css';

import Navbar from './Components/Navbar';
import Index from './Components/Index';
import Contact from './Components/Contact';

class App extends Component {
  render(){
    return (
      <div className="App">
        < Navbar />
        < Index />
        < Contact />
      </div>
    );
  }

}

export default App;
